import { NgModule, CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';
import { RouterModule } from '@angular/router';
import { SharedModule } from 'app/shared/shared.module';

import {
  ParamComponent,
  ParamDialogComponent,
  ParamDetailComponent,
  ParamPopupComponent,
  ParamDeleteDialogComponent,
  paramRoute,
  paramPopupRoute,
  ParamService,
  ParamPopupService,
} from './';

const ENTITY_STATES = [...paramRoute, ...paramPopupRoute];

@NgModule({
  imports: [SharedModule, RouterModule.forChild(ENTITY_STATES)],
  declarations: [ParamComponent, ParamDialogComponent, ParamDetailComponent, ParamPopupComponent, ParamDeleteDialogComponent],
  entryComponents: [ParamComponent, ParamDialogComponent, ParamDetailComponent, ParamPopupComponent, ParamDeleteDialogComponent],
  providers: [ParamService, ParamPopupService],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
})
export class ParamModule {}
